import React from 'react';
import WordButton from './WordButton';
const WordButtonList = ({ words }) => {


  const renderWords = () => {
    return words.map(word => {
      return <WordButton word={word} />
    })
  }

  return (
    <div>
      {renderWords()}
    </div>
  )
}

export default WordButtonList;
